import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';
import Button from '@material-ui/core/Button';
import NestedListView, {NestedRow} from 'react-native-nested-listview';

function App() {

  const [shit, setShit] = useState("I am shit");
  const [open, setOpen] = React.useState(true);

  const handleClick = () => {
    setOpen(!open);
  };

  var shit_data = () => {
    console.log("Someone wants bigger shit")
    fetch('http://localhost:4000/shit').then(resp => resp.json()).then(resp => setShit(resp.message)).catch(err => console.log(err))
  }

  const recent_view = ["a", "b", "c", "d"];

  const data = [{title: 'Node 1', items: [{title: 'Node 1.1'}, {title: 'Node 1.2'}]}]

  return (
    <div className="App">
        <Button id="shitbutton" variant="contained" color="primary" onClick={shit_data}> Click me to get a big shit </Button>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          {shit}
        </a>

        <List
           component="nav"
           aria-labelledby="nested-list-subheader"
           className={classes.root}
         >
           <ListItem button>
             <ListItemText primary="Recent View" />
           </ListItem>
           <ListItem button>
             <ListItemText primary="Favourites" />
           </ListItem>
           <ListItem button onClick={handleClick}>
             <ListItemText primary="Inbox" />
             {open ? <ExpandLess /> : <ExpandMore />}
           </ListItem>
           <Collapse in={open} timeout="auto" unmountOnExit>
             <List component="div" disablePadding>
               <ListItem button className={classes.nested}>
                 <ListItemIcon>
                   <StarBorder />
                 </ListItemIcon>
                 <ListItemText primary="Starred" />
               </ListItem>
             </List>
           </Collapse>
         </List>
        />


      <body>
      <div>

      </div>


      </body>

    </div>
  );
}

export default App;
